import React from "react";
import "./Ongoing.css";
import { AiFillDelete } from "react-icons/ai";

const Ongoing = () => {
  return (
    <div className="Ongoing">
      <div className="left">
        <input type="checkbox" />
        <p>ToDo</p>
      </div>
      <div className="right">
        <AiFillDelete />
        <p>Edit</p>
      </div>
    </div>
  );
};

export default Ongoing;
